import { Outlet, Link } from "react-router-dom";

// Define styles as a const
const landingPageStyles = {
  maxWidth: "800px",
  margin: "0 auto",
  padding: "20px",
};

const headerStyles = {
  textAlign: "center",
  padding: "20px 0",
};

const h1Styles = {
  fontSize: "2em",
  color: "#333",
};

const navUlStyles = {
  listStyleType: "none",
  padding: 0,
};

const navUlLiStyles = {
  display: "inline",
  marginRight: "20px",
};

const navUlLiLinkStyles = {
  textDecoration: "none",
  color: "#333",
  fontWeight: "bold",
};

const LandingPage = () => {
  return (
    <div style={landingPageStyles}>
      <header style={headerStyles}>
        <h1 style={h1Styles}>SeniorSync</h1>
      </header>
      <nav>
        <ul style={navUlStyles}>
          <li style={navUlLiStyles}>
            <Link to="/metrics" style={navUlLiLinkStyles}>Metrics</Link>
          </li>
        </ul>
      </nav>
      <Outlet />
    </div>
  );
};

export default LandingPage;
